    fullName:"",
    phone:"",
    email:"",
    address:"",
    age:"",
    bloodGroup:""
}
const DCandidateForm = ( props ) => {
    const {values,setValues} = useState()
    return (  
    <form autoComplete="off" noValidate>
        <Grid container>
            <Grid item xs={6}>
                <TextField id="dcandidate_fullname" name="fullName" variant="outlined" label="Full Name" />
            </Grid>
            <Grid item xs={6}>
                
            </Grid>
        </Grid>
    </form> );
}

export default DCandidateForm;
